    @condenser_type.setter
    def condenser_type(self, value="AirCooled"):
        """  Corresponds to IDD Field `Condenser Type`

        Args:
            value (str): value for IDD Field `Condenser Type`
                Accepted values are:
                      - AirCooled
                      - EvaporativelyCooled
                Default value: AirCooled
                if `value` is None it will not be checked against the
                specification and is assumed to be a missing value

        Raises:
            ValueError: if `value` is not a valid value
        """
        if value is not None:
            try:
                value = str(value)
            except ValueError:
                raise ValueError('value {} need to be of type str'
                                 ' for field `CoilCoolingDxSingleSpeedThermalStorage.condenser_type`'.format(value))
            if ',' in value:
                raise ValueError('value should not contain a comma '
                                 'for field `CoilCoolingDxSingleSpeedThermalStorage.condenser_type`')
            if '!' in value:
                raise ValueError('value should not contain a ! '
                                 'for field `CoilCoolingDxSingleSpeedThermalStorage.condenser_type`')
            vals = {}
            vals["aircooled"] = "AirCooled"
            vals["evaporativelycooled"] = "EvaporativelyCooled"
            value_lower = value.lower()
            if value_lower not in vals:
                found = False
                if not self.strict:
                    for key in vals:
                        if key in value_lower or value_lower in key:
                            value_lower = key
                            found = True
                            break
                    if not found:
                        value_stripped = re.sub(r'[^a-zA-Z0-9]', '', value_lower)
                        for key in vals:
                            key_stripped = re.sub(r'[^a-zA-Z0-9]', '', key)
                            if key_stripped == value_stripped:
                                value_lower = key
                                found = True
                                break
                if not found:
                    raise ValueError('value {} is not an accepted value for '
                                     'field `CoilCoolingDxSingleSpeedThermalStorage.condenser_type`'.format(value))
                else:
                    logger.warn('change value {} to accepted value {} for '
                                 'field `CoilCoolingDxSingleSpeedThermalStorage.condenser_type`'.format(value, vals[value_lower]))
            value = vals[value_lower]
        self._data["Condenser Type"] = value

